import './App.css';

function App() {
  const title = "Welcome to the blog";
  const like = 50;
  // const person = {name:'anas',age:30};
  return (
    <div classname = "App">
      <div classname = "content">
        <h1>{title}</h1>
        <p>Liked{likes}</p>

        <p>{10}</p>
        <p>{"hello,ninjas"}</p>
        <p>[1,2,3,4,5]</p>
        <p>{Math.random()*10}</p>
      </div>
    </div>

  );
}

export default App;
